					await message.channel.send(`${user}, rakibinin bileğini bükmeye çalışmaktan vazgeçip kendi bileğini korudu!`);
					guard = true;
					reset(false);
				} else if (choice === 'yüklen') {
					const miss = Math.floor(Math.random() * 4);
					if (!miss) {
						const damage = randomRange(100, guard ? 20 : 80);
